`,stats:{STR:19,DEX:11,CON:19,INT:3,WIS:14,CHA:10}},{id:"t9cfyom4g",name:"Chuul",hp:93,AC:16,type:"aberration",speed:30,speedSwim:30,speedFly:0,immunities:["Poison","Poisoned"],resistances:[],vulnerabilities:[],savingThrows:[],skills:["Perception +4"],senses:["Darkvision 60 ft.","Passive Perception 14"],challenge:"4 (1,100 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/241/1000/1000/636252767122656355.jpeg",size:"large",alignment:"chaotic evil",isPlayer:!1,notes:`
