`,stats:{STR:15,DEX:12,CON:13,INT:14,WIS:11,CHA:13}},{id:"bcpesu3ni",name:"Couatl",hp:97,AC:19,type:"celestial",speed:30,speedSwim:10,speedFly:90,immunities:["Psychic; Bludgeoning","Piercing","and Slashing from Nonmagical Attacks"],resistances:["Radiant"],vulnerabilities:[],savingThrows:["CON +5","WIS +7","CHA +6"],skills:[],senses:["Truesight 120 ft.","Passive Perception 15"],challenge:"4 (1,100 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/257/1000/1000/636252768143323827.jpeg",size:"medium",alignment:"lawful good",isPlayer:!1,notes:`
