`,stats:{STR:17,DEX:15,CON:15,INT:3,WIS:12,CHA:7}},{id:"7kdtqre6h",name:"Djinni",hp:161,AC:17,type:"elemental",speed:30,speedSwim:10,speedFly:90,immunities:["Lightning","Thunder"],resistances:[],vulnerabilities:[],savingThrows:["DEX +6","WIS +7","CHA +9"],skills:[],senses:["Darkvision 120 ft.","Passive Perception 13"],challenge:"11 (7,200 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/281/315/315/636252770322204007.jpeg",size:"large",alignment:"chaotic good",isPlayer:!1,notes:`
