`,stats:{STR:15,DEX:16,CON:11,INT:2,WIS:12,CHA:6}},{id:"3y768uwos",name:"Giant Boar",hp:42,AC:12,type:"beast",speed:40,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:[],senses:["Passive Perception 8"],challenge:"2 (450 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/attachments/2/648/beast.jpg",size:"large",alignment:"unaligned",isPlayer:!1,notes:`
