`,stats:{STR:16,DEX:13,CON:15,INT:14,WIS:15,CHA:16}},{id:"jdixgkfda",name:"Lemure",hp:13,AC:7,type:"fiend",speed:15,speedSwim:10,speedFly:0,immunities:["Fire","Poison","Charmed","Frightened","Poisoned"],resistances:["Cold"],vulnerabilities:[],savingThrows:[],skills:[],senses:["Darkvision 120 ft.","Passive Perception 10"],challenge:"0 (10 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/149/1000/1000/636252758704142054.jpeg",size:"medium",alignment:"lawful evil",isPlayer:!1,notes:`
