`,stats:{STR:9,DEX:14,CON:11,INT:17,WIS:12,CHA:11}},{id:"410i6oius",name:"Magma Mephit",hp:22,AC:11,type:"elemental",speed:30,speedSwim:10,speedFly:30,immunities:["Fire","Poison","Poisoned"],resistances:[],vulnerabilities:["Cold"],savingThrows:[],skills:["Stealth +3"],senses:["Darkvision 60 ft.","Passive Perception 10"],challenge:"1/2 (100 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/18/292/315/315/636379804350894228.jpeg",size:"small",alignment:"neutral evil",isPlayer:!1,notes:`
