`,stats:{STR:12,DEX:16,CON:11,INT:12,WIS:10,CHA:14}},{id:"iodvmym9t",name:"Scorpion",hp:1,AC:11,type:"beast",speed:10,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:[],senses:["Blindsight 10 ft.","Passive Perception 9"],challenge:"0 (10 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/attachments/2/648/beast.jpg",size:"tiny",alignment:"unaligned",isPlayer:!1,notes:`
